INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (208,'eng-GB',1,71,131,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>\n    <line>My company desktop edition is a WYSIWYG (What You See Is What You Get) editor that you can connect to your eZ publish content management system.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (209,'eng-GB',1,71,132,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>DE lets you edit articles and images on your  web site through a familiar browser and word processing interface.</paragraph>\n  <paragraph>\n    <strong>Benefits of Desktop Edition</strong>\n  </paragraph>\n  <paragraph>The desktop edition editor lets you see more or less how the article will look on your site. The desktop edition can also open a web browser for previews of the resulting page. You can use DE for browsing the categories of articles and images of your site.</paragraph>\n  <paragraph>The desktop edition editor feels almost like an ordinary word processor which makes it really easy to learn. The article and image browsers immitate the functions of other file and image browsers. DE will make editing articles for your web site even easier.</paragraph>\n  <paragraph>\n    <strong>Requirements</strong>\n  </paragraph>\n  <paragraph>\n    <line>Supported operating systems are Linux x86, Win32 (Windows 95, 98, NT, Me, 2000 and XP), and Mac OS X 10.1.x.</line>\n  </paragraph>\n</section>',1045487555,0);
