INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (215,'eng-GB',1,72,132,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>My company Server optimized is a Linux distribution based on the Secure SoftLinux from My company. This linux server provides a secure, fast and easy way of getting the programs up and running in no time. My company software system is installed by default, configured and is ready to use as soon as the installation is complete.</paragraph>\n  <paragraph>My company Server optimizedalso comes with a fast log file analysis program, Herbalizer. Herbalizer is also configured and is ready to go after installation.</paragraph>\n</section>',1045487555,0);
