INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (222,'eng-GB',1,74,141,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>We are a company that handle business all around the world. Therefore the career opportunities in this company are diverse. </paragraph>\n  <paragraph>We want to provide our employees with the best possible opportunity to develop your own skills and knowledge so that both you and My company can benefit from it. We want people that shows initiative and that wants to feel happy for working with us. </paragraph>\n  <paragraph>My company is always looking for good co-workers. </paragraph>\n  <paragraph>If you are a person that thing you have something to offer please do not hesitate to send us an application. </paragraph>\n  <paragraph>\n    <line>Do you have the skill to make us better? </line>\n    <line>end an application by email to careers@mycompany.my </line>\n  </paragraph>\n</section>',1045487555,0);
