INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (119,'eng-GB',2,45,121,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>The numbers need to include:- Total sales- Total sales in $- Sales per product- Total calls made- Breakthrough rate (How many have bought)- Returns- Estimates for the next month</paragraph>\n  <paragraph>\n    <line>These numbers have to be in my mailbox before 1600 today.</line>\n  </paragraph>\n</section>',1045487555,0);
