INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (257,'eng-GB',1,82,120,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>Today we introduce the best wine lottery ever. The success of the lottery brings the wine quality one step up.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute (id, language_code, version, contentobject_id, contentclassattribute_id, data_text, data_int, data_float) VALUES (258,'eng-GB',1,82,121,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\"\n         xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\">\n  <paragraph>Since so many of you have joined this lottery earlier we will make it even more fun this time. In addition to the wine we also give away cheese and cracers to the lucky winners.</paragraph>\n  <paragraph>Drop by my office if you want to purchase a chance to win high quality wine. You can also send me an e-mail if you are prevented from coming.</paragraph>\n  <paragraph>The lottery ticket only cost $ 2.</paragraph>\n  <paragraph>Linda Loo</paragraph>\n</section>',1045487555,0);
